DROP DATABASE IF EXISTS `weather`;

CREATE DATABASE `weather`;
USE `weather`;

CREATE TABLE `weather_history_daily` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `station` varchar(30) NOT NULL,
  `date_time` varchar(10) NOT NULL,
  `high_temp` int(11) DEFAULT NULL,
  `low_temp` int(11) DEFAULT NULL,
  `humidity_max` int(11) DEFAULT NULL,
  `humidity_min` int(11) DEFAULT NULL,
  `pressure_max` float(5,2) DEFAULT NULL,
  `pressure_min` float(5,2) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

CREATE TABLE `weather_history_hourly` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `log_time` int(11) DEFAULT unix_timestamp(),
  `date_time` varchar(16) DEFAULT NULL,
  `desc_code` int(11) DEFAULT NULL,
  `temperature` int(11) DEFAULT NULL,
  `humidity` int(11) DEFAULT NULL,
  `pressure` float(5,2) DEFAULT NULL,
  `wind_direction` varchar(2) DEFAULT NULL,
  `wind_speed` int(11) DEFAULT NULL,
  `station` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=83 DEFAULT CHARSET=utf8mb4;

CREATE TABLE `cities_us` (
  `city_id` int(11) NOT NULL,
  `name` varchar(128) DEFAULT NULL,
  `state` varchar(2) DEFAULT NULL,
  `country` varchar(2) DEFAULT NULL,
  `longitude` varchar(16) DEFAULT NULL,
  `latitude` varchar(16) DEFAULT NULL,
  PRIMARY KEY (`city_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

